import React from 'React';
import { Alert } from 'react-bootstrap';

const GameAlert = (props) => {
    return (
        <div>
            {props.gameAlert.message &&
                <Alert variant={props.gameAlert.variant}>
                    <strong>
                        {props.gameAlert.message}
                    </strong>
                </Alert>
            }
        </div>
    )
}

export default GameAlert;
